import Head from "next/head";

export default (
  <div>
    <Head>
      <meta name="viewport" content="width=device-width, initial-scale=1" />
      <link rel="stylesheet" href="/static/main.css" />
    </Head>
    <style jsx global>{`
      body {
        height: 100vh;
      }
    `}</style>
  </div>
);
